import { useState, useEffect } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faDumbbell, faCirclePlay, faCirclePause } from '@fortawesome/free-solid-svg-icons'

const Timer = () => {
  const [workTime, setWorkTime] = useState({ minutes: 0, seconds: 0 });
  const [restTime, setRestTime] = useState({ minutes: 0, seconds: 0 });
  const [sets, setSets] = useState(1);
  const [currentSet, setCurrentSet] = useState(1);
  const [isRunning, setIsRunning] = useState(false);
  const [isRest, setIsRest] = useState(false);

  useEffect(() => {
    if (!isRunning) return;
    const timerId = setInterval(() => {
      handleTick();
    }, 1000);
    return () => clearInterval(timerId);
  }, [isRunning, isRest]);

  const handleWorkTime = (minutes, seconds) => {
    setWorkTime({ minutes, seconds });
  };

  const handleRestTime = (minutes, seconds) => {
    setRestTime({ minutes, seconds });
  };

  const handleSets = (num) => {
    setSets(num);
  };

  const handleReset = () => {
    setIsRunning(false);
    setCurrentSet(1);
    setIsRest(false);
    setWorkTime({ minutes: 0, seconds: 0 });
    setRestTime({ minutes: 0, seconds: 0 });
    setSets(1);
  };

  const handleStart = () => {
    setIsRunning(true);
  };

  const handlePause = () => {
    setIsRunning(false);
  };

  const handleTick = () => {
    if (isRest) {
      if (restTime.minutes === 0 && restTime.seconds === 0) {
        setCurrentSet(currentSet + 1);
        if (currentSet === sets) {
          setIsRunning(false);
        } else {
          setIsRest(false);
        }
      } else if (restTime.seconds === 0) {
        setRestTime({ minutes: restTime.minutes - 1, seconds: 59 });
      } else {
        setRestTime({ ...restTime, seconds: restTime.seconds - 1 });
      }
    } else {
      if (workTime.minutes === 0 && workTime.seconds === 0) {
        setIsRest(true);
        setRestTime({ ...restTime });
      } else if (workTime.seconds === 0) {
        setWorkTime({ minutes: workTime.minutes - 1, seconds: 59 });
      } else {
        setWorkTime({ ...workTime, seconds: workTime.seconds - 1 });
      }
    }
  };

  return (
    <div className="timerPage">
      <div className="timer">
        <div className="timeDisplay">{`${isRest ? restTime.minutes : workTime.minutes
          }:${isRest ? restTime.seconds : workTime.seconds}`}</div>

        <FontAwesomeIcon icon={faDumbbell} />
        <div className="setsDisplay">{`Set ${currentSet} of ${sets}`}</div>

        <div className="controlButtons">
          {isRunning ? (
            <FontAwesomeIcon icon={faCirclePause} onClick={handlePause} />
          ) : (
            <FontAwesomeIcon icon={faCirclePlay} onClick={handleStart} />
          )}
        </div>
      </div>
      <div className="settings">
        <div className="workTime">
          <label>Work</label>

          <input type="number" min="0" max="60" onChange={(e) => {
            const time = parseInt(e.target.value, 10);
            handleWorkTime(Math.floor(time / 60), time % 60);
          }} />
          <span>min</span>

          <input type="number" min="0" max="59" onChange={(e) => {
            const time = parseInt(e.target.value, 10);
            handleWorkTime(workTime.minutes, time);
          }} />
          <span>sec</span>

        </div>
        <div className="restTime">
          <label>Rest</label>

          <input type="number" min="0" max="60" onChange={(e) => {
            const time = parseInt(e.target.value, 10);
            handleRestTime(Math.floor(time / 60), time % 60);
          }} />
          <span>min</span>

          <input type="number" min="0" max="59" onChange={(e) => {
            const time = parseInt(e.target.value, 10);
            handleRestTime(restTime.minutes, time);
          }} />
          <span>sec</span>
        </div>
        <div className="sets">
          <label>Sets</label>
          <input type="number" min="1" max="20" value={sets} onChange={(e) => {
            const num = parseInt(e.target.value, 10);
            handleSets(num);
          }} />
        </div>
        <button onClick={handleReset}>Reset</button>
      </div>
    </div>
  );
};

export default Timer;
